ERROR - 2013-11-27 10:06:17 --> 42000 - SQLSTATE[42000]: Syntax error or access violation: 1064 You have an error in your SQL syntax; check the manual that corresponds to your MySQL server version for the right syntax to use near 's fist. Stems are terete, bearing numerous little tubers. Leaves are simple, ova' at line 1 with query: "INSERT INTO `plants` (`name`,`scientific_names`, `common_names`, `vernacular_names`, `properties`, `usage`,`filename`) VALUES('Ubi-ubihan','Dioscorea bulbifera||Dioscorea heterophylla||Dioscorea latifolia||Dioscorea oppositifolia||Dioscorea sativa||Dioscorea violacea||Dioscorrea tamifolia||Helmia bulbifera||Huang du','Aribukbuk (Ilk.)||Bayag-kabayo (Tag.)||Dadakan (Bag.)||Pulugan (Bik.)||Ubi-ubihan (Tag.)||Utong-utoñgan (Tag.)||Aerial yam (Engl.)||Air potato (Engl.)||Bitter yam (Engl.)||Potato yam (Engl.)||Huang yao zu (Chin.)','','Ubi-ubihan is a climbing or twining, dioecious, smooth, unarmed vine reaching a length of several meters. Tubers are rounded, not larger than a man's fist. Stems are terete, bearing numerous little tubers. Leaves are simple, ovate, 7 to 14 centimeters long, with a broad and prominently heart-shaped base, broad and rounded sinus, rounded lobes, and 7- to 9-nerved. Spikes are slender, panicled, numerous, 8 to 10 centimeters long, and rather densely many-flowered. Flowers are about 3 millimeters long. Capsules are longer than broad. Seeds are winged at the base only. In the wild, tubers, when fresh, are bitter. Cultivated tubers are less or non-bitter. Tubers considered tonic, expectorant, aphrodisiac and anthelmintic.','Tubers taken internally as remedy for dysentery and syphilis.||Tubers used as resolvent for boils and as diuretic.||Powdered tubers used as application for sores, piles and to stop diarrhea.||In India, a folk remedy used to cure wounds, leucoderma and boils. Also, used as tonic, expectorant in asthma, as aphrodisiac and anthelmintic.||In Chinese medicine, used to treat diseases of the lungs, kid